import React from 'react';
import Calculator from './Calculator'
import history from './history'
import './Done.css'
export default class Done extends React.Component {
    constructor(props) {
      super(props);
      this.state={
        calculator:''
      }
      
    }
    componentDidMount()
    {
      let calculator=history.location.state.details;
      this.setState({
          calculator:calculator
      })
      
    }
    render() {
      return <div id="done">
         <img id="principal_image" class="doneImage" src={require('./assets/Background.png')}></img>
         <div id="results">
        <div id="army1">
            <h3>Your score:{this.state.calculator.score1}
            </h3>
        </div>
        <div id="army2">
             <h3>Enemy score:{this.state.calculator.score2}</h3>
        </div>
        </div>
        </div>
    }
  }
